import React from 'react';

/**
 * Gallery component
 * Displays a row of placeholder images reminiscent of the photo
 * gallery on the original site. These images can easily be replaced
 * with your own photographs by adjusting the src properties.
 */
const Gallery = () => {
  const images = [
    {
      src: './../cuadrado1.jpg',
      alt: 'Imagen 1',
    },
    {
      src: 'https://via.placeholder.com/600x400?text=Imagen+2',
      alt: 'Imagen 2',
    },
    {
      src: 'https://via.placeholder.com/600x400?text=Imagen+3',
      alt: 'Imagen 3',
    },
  ];

  return (
    <section className="gallery">
      <div className="gallery-row">
        {images.map((img, idx) => (
          <div className="gallery-item" key={idx}>
            <img src={img.src} alt={img.alt} />
          </div>
        ))}
      </div>
    </section>
  );
};

export default Gallery;
